While there are already countless math libraries for performing common matrix/array functions, StarMath is distinguished by its simplicity and flexbility. There is no need to declare vectors and matrices in a specific library format. It works simliar to Math.function calls in C#. 
The library is small and fully compiles to a Portable Class Library (for all platforms). StarMath (version > 2.0) takes advantage of  'extensions', which allows for concise representations of many functions. Now you can write either:
 StarMath.multiply(A, x);
 or
 A.multiply(x);

linear algebra, matrix, eigen, eigenvalues, eigenvectors, singular value decomposition, svd, matrix inversion, matrix solve, Ax=b

summary:
How to use :

	1. Create Console application, say, MyService.exe with

	class Program
    	{
        	static void Main(string[] args)
        	{
            		Action<IAppBuilder> startup = b =>
            		{
                		var config = new HttpConfiguration();
                		config.MapHttpAttributeRoutes();
                		b.UseWebApi(config);
                		// ..etc..
            		};
	    		var port = 12345; // must be >= 8000
            		var microService = new OwinMicroService(port,startup);
            		microService.Run(args);        
        	}
    	}
	2. Add a number of ApiControllers to the project. You can use the controllers in the application assembly only.
	3. If you wish to install it as a windows service, you have to add 2 classes to the project:
   		3.1. public class MicroServiceInstaller : ProjectInstaller { }
   		3.2. public class MicroServiceService : InternalService { }

	4.1 To run as console application : use command 'MyService.exe'
	4.2 To install as windows service (you must be the administrator) : use command 'MyService.exe -install'
	4.3 To uninstall : use command 'MyService.exe -uninstall'

